window.bookSummaryJSON = "<p>Only one of them can win. </p> <p>Kiri Helena Solene is done burying her loved ones. She is going to put an end to this war, one way or another. </p> <p>Even if it means she loses herself in the process. </p> <p>But in matters of war, Rowena has no intention of losing. The Corruptor knows Helena's greatest strength is also her weakness, and she has every intention of exploiting it. </p> <p>Especially if that means removing key players from the board. </p> <p>The path ahead is fraught with betrayal. The only thing that's certain....</p> <p>It won't end until one of them is dead. </p> <p><b><i>Contains mature themes.</i></b></p>"; 
